const getValidMove = (x,y,dir)=>{
	if(input[y][x] === '+'){
		switch(dir){
			case 'D':
				if(input[y][x+1] && input[y][x+1].match(/-|\w|\+/)){
					return {y,x:x+1, dir:'R'};
				}
				if(input[y][x-1] && input[y][x-1].match(/-|\w|\+/)){
					return {y,x:x-1, dir:'L'};
				}
				return null;
			case 'U':
				if(input[y][x+1] && input[y][x+1].match(/-|\w|\+/)){
					return {y,x:x+1, dir:'R'};
				}
				if(input[y][x-1] && input[y][x-1].match(/-|\w|\+/)){
					return {y,x:x-1, dir:'L'};
				}
				return null;
			case 'L':
				if(input[y+1][x] && input[y+1][x].match(/\||\w|\+/)){
					return {y:y+1,x, dir:'D'};
				}
				if(input[y-1][x] && input[y-1][x].match(/\||\w|\+/)){
					return {y:y-1,x, dir:'U'};
				}
				return null;
			case 'R':
				if(input[y+1][x] && input[y+1][x].match(/\||\w|\+/)){
					return {y:y+1,x, dir:'D'};
				}
				if(input[y-1][x] && input[y-1][x].match(/\||\w|\+/)){
					return {y:y-1,x, dir:'U'};
				}
				return null;
		}
	}
	else{
		switch(dir){
			case 'D':
				return input[y+1][x] && input[y+1][x].match(/\||-|\w|\+/) ? {y: y + 1, x, dir:'D'} : null;
			case 'U':
				return input[y-1][x] && input[y-1][x].match(/\||-|\w|\+/) ? {y: y - 1, x, dir:'U'} : null;
			case 'L':
				return input[y][x-1] && input[y][x-1].match(/\||-|\w|\+/) ? {y, x: x - 1, dir:'L'} : null;
			case 'R':
				return input[y][x+1] && input[y][x+1].match(/\||-|\w|\+/) ? {y, x: x + 1, dir:'R'} : null;
		}
	}
}

var x = input[0].indexOf('|'), y =0, pathString = '', currentDir = 'D', steps = 1;
var nextMove = getValidMove(x,y,currentDir);
while(nextMove){
	steps++;
	x = nextMove.x;
	y = nextMove.y;
	currentDir = nextMove.dir;
	
	if(input[y][x].match(/\w/)){
		pathString += input[y][x];
	}
	
	nextMove = getValidMove(x,y,currentDir);
}


console.log(`First Part: ${pathString}`);
console.log(`Second Part: ${steps}`);